import axios from 'axios'

const options = {
  method: 'GET',
  headers: {
    'X-RapidAPI-Key': '8dbed8a7c8msh74a62156e231f4dp12aa9ejsn7e17659100b2',
    'X-RapidAPI-Host': 'exercisedb.p.rapidapi.com'
  }
};

try {
	const response = await axios.request(options);
	console.log(response.data);
} catch (error) {
	console.error(error);
}
